const VedioDetails = ({ vedio }) =>{
  if(!vedio){
    return <div>Loading....</div>;
  }
  return (

    <div className ='ui segment'>
    <h4 className='ui header'>  {vedio.snippet.title} </h4>
    <p>{vedio.snippet.description}</p>
      </div>
  )
}

export default VedioDetails;
